 text</p>\n'),(178,'fr','Filler','<p>Filler text</p>\n'),(179,'en','Filler','<p>Filler text</p>\n'),(179,'fr','Filler','<p>Filler text</p>\n'),(180,'en','Filler','<p>Filler text</p>\n'),(180,'fr','Filler','<p>Filler text</p>\n'),(181,'en','Filler','<p>Filler text</p>\n'),(181,'fr','Filler','<p>Filler text</p>\n'),(182,'en','Filler','<p>Filler text</p>\n'),(182,'fr','Filler','<p>Filler text</p>\n'),(183,'en','Filler','<p>Filler text</p>\n'),(183,'fr','Filler','<p>Filler text</p>\n'),(184,'en','Filler','<p>Filler text</p>\n'),(184,'fr','Filler','<p>Filler text</p>\n'),(185,'en','Filler','<p>Filler text</p>\n'),(185,'fr','Filler','<p>Filler text</p>\n'),(186,'en','Filler','<p>Filler text</p>\n'),(186,'fr','Filler','<p>Filler text</p>\n'),(187,'en','Filler','<p>Filler text</p>\n'),(187,'fr','Filler','<p>Filler text</p>\n'),(188,'en','Filler','<p>Filler text</p>\n'),(188,'fr','Filler','<p>Filler text</p>\n'),(189,'en','Filler','<p>Filler text</p>\n'),(189,'fr','Filler','<p>Filler text</p>\n'),(190,'en','Filler','<p>Filler text</p>\n'),(190,'fr','Filler','<p>Filler text</p>\n'),(207,'en','Započni karijeru kao iOS developer – otvorene su prijave na online iOS akademiju! ','<p><strong>Rok za prijave je 04.04.2021.</strong> prijaviti se mogu studenti, ne-studenti ili jednostavno rečeno – svi koji se žele okušati u iOS svijetu 🙂&nbsp;</p>\n\n<h2>Sigurno želiš znati kako smo zamislili online iOS akademiju? Čitaj dalje…</h2>\n\n<ul>\n	<li>Osigurat ćemo svu potrebnu <strong>opremu</strong> koja će ti stići doma netom prije početka akademije&nbsp;</li>\n	<li>Nakon prošlogodišnje iOS akademije, skupili smo dojmove i feedback polaznika te pripremili još <strong>više materijala i zadataka</strong> s kojima želimo podići kvalitetu akademije&nbsp;</li>\n	<li>Osigurali smo vrijeme za mentore i iOS tim koji će voditi iOS akademiju i biti dostupni preko Google Hangoutsa i Slacka, a također planiramo napraviti Discord kanal za polaznike iOS akademije gdje se možete družiti cijelo vrijeme&nbsp;</li>\n	<li>3 mjeseca <strong>zaokruženog procesa učenja o iOS programiranju</strong>&nbsp; gdje ćemo pokriti 10 ključnih poglavlja, zadatke i mentoriranje za svakog polaznika kako bi vas što bolje uveli u iOS svijet</li>\n</ul>\n\n<p><a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"https://factory.hr/blog/ios-akademija-recap\" tabindex=\"-1\">Prva iOS akademija</a> rezultirala je zapošljavanjem novog kolege u našem iOS timu; održali smo 8 radionica, tjedne konzultacije sa svim članovima tima i polaznika te su nas polaznici po završetku akademije ocijenili prosječnom ocjenom od 4.8 po kvaliteti predavanja, predavačima i pripremi materijala i zadataka.&nbsp;</p>\n\n<h3>Remote/Online iOS akademija</h3>\n\n<ul>\n	<li>Factory je <strong>remote first tvrtka</strong> gdje smo utvrdili procese remote rada, stoga svaki zaposlenik zna u bilo kojem trenutku kome i kako se obratiti</li>\n	<li>S ovom iOS akademijom želimo <strong>dati šansu cijeloj Hrvatskoj</strong> i osigurati adekvatno učenje za područja u kojima inače nema sličnih akademija ili predavanja&nbsp;</li>\n	<li>2020.g smo dobili nagradu za<strong> najbolje stručne prakse</strong>, stoga imamo iskustva rada s početnicima i usmjeravanjem početnika kroz učenje programiranja na bilo kojim platformama</li>\n</ul>\n\n<p><a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"https://forms.gle/uVsxxm3Yjfa98ZsDA\" tabindex=\"-1\"><img alt=\"remote ios akademija\" class=\"alignnone size-full wp-image-12205\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/remote-ios-akademija.png\" style=\"height:442px; width:885px\" /></a></p>\n\n<p>Ako ti ne radi klik na sliku, <a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"http://bit.ly/FactoryiOSAkademija\" rel=\"noopener noreferrer\" tabindex=\"-1\" target=\"_blank\">evo linka na kojeg se možeš prijaviti</a> 🙂</p>\n\n<h2><strong>Detalji iOS akademije:</strong></h2>\n\n<p><strong>1. Korak – prijava</strong></p>\n\n<p>Prijave na iOS akademiju otvorene su&nbsp; od <strong>22.03.2021. – 04.04. 2021.</strong></p>\n\n<p>Sve koji se žele prijaviti na iOS akademiju molimo da pošalju svoj životopis i motivacijsko pismo. Također, ako imate dosadašnjih radova, slobodno stavite link do GitHub repozitorija 🙂&nbsp;</p>\n\n<p><strong>2. Korak – selekcija</strong></p>\n\n<p>Nakon <strong>zatvaranja prijava 04.04.2021.</strong>&nbsp; provest ćemo selekcijski postupak te izabrati <strong>5 najboljih kandidata</strong> koji će osigurati svoje mjesto na iOS akademiji! Trajanje selekcije je estimirano na mjesec dana, najviše ovisi o broju prijavljenih kandidata jer svakome želimo dati šansu da pokaže svoju motivaciju.&nbsp;</p>\n\n<p>Kako će izgledati selekcija:&nbsp;</p>\n\n<ul>\n	<li>Pregled prijava i motivacijskog pisma</li>\n	<li>Testiranje</li>\n	<li>Intervju</li>\n</ul>\n\n<p>U procesu selekcije bit ćemo usmjereni na razinu motivacije, koliko si je kandidat dao truda ranije u development te ambicije za daljnje učenje i razvoj.&nbsp;</p>\n\n<p><strong>3. Korak – početak iOS akademije</strong></p>\n\n<p>Početak akademije i prvo predavanje planiramo održati početkom 5.mjeseca. Dinamika radionica i termina će se dogovarati na tjednoj razini sukladno mogućnostima i potrebama polaznika.&nbsp;</p>\n\n<h2>Zašto je iOS akademija za tebe?</h2>\n\n<ul>\n	<li>Nedostaje ti adekvatna oprema&nbsp;</li>\n	<li>Želiš provjeriti dosadašnje znanje na konkretnim zadacima</li>\n	<li>Želiš pronaći mentora, upoznati iskusne kolege na koje možeš računati kad više ni sam/sama ne znaš pronaći rješenje</li>\n	<li>Ili, imaš iskustva u drugim tehnologijama, ali te zanima i iOS</li>\n</ul>\n\n<p><strong>Ako ti se ovakva ili slična pitanja motaju po glavi – prijavi se na iOS akademiju!&nbsp;</strong></p>\n\n<p>Oni koji se pronađu u iOS developmentu, uvijek je otvorena prilika za pridruživanju Factory timu kroz posao ili praksu – ovisno o trenutnom iskustvu. Ekipa smo koja voli čuti feedback na naš rad, želje koje imate pred sobom te kako vam Factory može pomoći da ih ostvarite.&nbsp;</p>\n\n<h2>Upoznaj mentore i voditelje iOS akademije</h2>\n\n<h3><strong>Josip, iOS developer&nbsp;</strong></h3>\n\n<p><img alt=\"predavac ios akademija\" class=\"alignnone size-full wp-image-12203\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/predavac-ios-akademija.png\" style=\"height:588px; width:885px\" /></p>\n\n<p>Josip se pridružio našem timu 2019. godine na <a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"https://factory.hr/blog/ios-developer-prakse\" tabindex=\"-1\">iOS developer praksi</a><strong>, </strong>a danas je naš iOS developer koji će biti jedan od mentora i voditelja iOS akademije! Na prošlogodišnjoj iOS akademiji je također sudjelovao i pomagao iOS polaznicima te uvijek vrlo rado dijeli znanje i priča o novim Apple proizvodima. Trenutno radi na par iOS aplikacija za hrvatsko, američko i njemačko tržište.&nbsp;</p>\n\n<p>Uz Joleta i njegove fore vam sigurno neće biti dosadno na akademiji i uvijek će vam pomoći kada zapnete i ne znate što dalje googlati da dođete do rješenja.&nbsp;</p>\n\n<h3><strong>Zvonimir, ex iOS akademija polaznik, danas iOS developer&nbsp;</strong></h3>\n\n<p><img alt=\"predavaci iOS akademije\" class=\"alignnone size-full wp-image-12204\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/predavaci-iOS-akademije.png\" style=\"height:588px; width:885px\" /></p>\n\n<p>Zvonimir se našem timu pridružio na prošlogodišnjoj iOS akademiji gdje je uz mentore i radionice uspješno riješio sve zadatke koji su se našli pred njim i time osigurao poziciju iOS developera u našem timu! Danas je naš iOS developer koji radi na par projekata za hrvatsko, američko i njemačko tržište, a od njega možete iz prve ruke saznati kako je bilo na prošlogodišnjoj iOS akademiji:&nbsp;</p>\n\n<h2>“Uz mentora je sve lakše i zabavnije”</h2>\n\n<p><img alt=\"iOS akademija\" class=\"alignnone size-full wp-image-12201\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/iOS-akademija.png\" style=\"height:152px; width:885px\" /></p>\n\n<h3><strong>Matija, COO, Mobile team lead</strong></h3>\n\n<p><img alt=\"iOS akademija Osijek\" class=\"alignnone size-full wp-image-9353\" src=\"https://api.factory.hr/wp-content/uploads/2020/01/iOS-akademija-Osijek.jpg\" style=\"height:588px; width:885px\" /></p>\n\n<p>Kao alfa i omega našeg mobile tima, Matija je zadužen za kontrolu i provedbu iOS akademije. Broji petogodišnje iskustvo u razvoju Android i iOS aplikacija, izgradio je uspješan tim iza sebe te će uz našeg Josipa i Zvonimira biti zadužen za podršku i konzultacije.&nbsp;</p>\n\n<h2>Studentska udruga eStudent nagradila je naše <a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"https://factory.hr/blog/prakse-zlatni-indeks\" rel=\"noopener noreferrer\" tabindex=\"-1\" target=\"_blank\">prakse Zlatnim indeksom&nbsp;</a></h2>\n\n<p>… a sada smo ih pitali kako vide našu iOS akademiju iz perspektive studenata:</p>\n\n<p><img alt=\"iOS akademija studenti\" class=\"alignnone size-full wp-image-12221\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/iOS-akademija-studenti.png\" style=\"height:899px; width:894px\" /> <img alt=\"ios development akademija\" class=\"alignnone size-full wp-image-12222\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/ios-development-akademija.png\" style=\"height:907px; width:894px\" /></p>\n\n<p><em>Hvala vrijednim studentima na divnim komentarima i riječima podrške, nadamo se da ćemo opravdati povjerenje! 🙂</em></p>\n\n<h2>Tko pita – ne skita</h2>\n\n<p><strong>Kada počinje Akademija?</strong></p>\n\n<p>Prva predavanja iOS akademije počinje početkom 5.mjeseca 2021. Točan datum ćemo dogovoriti tako da odgovara polaznicima i našim mentorima.&nbsp;</p>\n\n<p><strong>Trebam li imati predznanja iz iOS-a?</strong></p>\n\n<p>Ne. Sasvim je ok ako imaš predznanja iz bilo kojeg drugog područja – pr. Androida ili Weba.&nbsp;</p>\n\n<p><strong>Ne znam puno o programiranju, ima li smisla da se prijavim?</strong></p>\n\n<p>Naravno, svrha Akademije je naučiti.&nbsp;</p>\n\n<p><strong>Još sam student, nemam projekata iza sebe, mogu li se prijaviti?</strong></p>\n\n<p>Naravno! Cilj Akademije je pomoći onima koji imaju potencijala i ambicije postati iOS developeri.&nbsp;</p>\n\n<p><strong>Kako će izgledati radionice?</strong></p>\n\n<p>Radionice će biti praktične uz vodstvo i pomoć naših kolega iz iOS tima. Tempo i dinamika će se prilagođavati napretku polaznika. Cilj nam je pomoći vam da naučite što više i što bolje – ne da projurimo kroz definiran program.&nbsp;</p>\n\n<p><strong>Što ako budem odabran u Akademiju pa mi iskrsne neka obaveza i ne mogu prisustvovati određenoj radionici?</strong></p>\n\n<p>Nastojat ćemo prilagoditi termine mogućnostima i potrebama grupe – da većina uspije izvući maksimum.</p>\n\n<p><strong>Što ako nemam opremu?</strong></p>\n\n<p>Factory će osigurati opremu za sve polaznike koja će doći na tvoja vrata prije početka iOS akademije.</p>\n\n<p><strong>Koliko košta sudjelovanje u iOS akademiji?</strong></p>\n\n<p>Za polaznike je besplatno. Factory će osigurati mentore, opremu i vrijeme.&nbsp;</p>\n\n<p><strong>Kako će izgledati proces selekcije?</strong></p>\n\n<p>Prvo ćemo pregledati dobivene prijave (vaše CV i motivacijska pisma), nakon čega ćemo pozvati odabrane na psihologijsko i manje tehničko testiranje da vidimo trenutno predznanje te zatim na intervju.&nbsp;</p>\n\n<p><strong>Zašto samo 5 polaznika?</strong></p>\n\n<p>Smatramo da za 5 možemo osigurati dovoljno vremena i resursa da im se posvetimo kvalitetno i pružimo maksimalno. Cilj nam je dovesti nekoga do razine da nakon Akademije može samostalno nastaviti razvijati se ili početi raditi kao iOS developer. S povećanjem broja polaznika smanjuje se interakcija i posvećenost prema pojedinom polazniku. Također, voljeli bismo potaknuti i osigurati doživljaj timskog rada polaznicima tako da polaznici dobiju iskustvo i u tom aspektu.&nbsp;</p>\n\n<h3>Da ne skrolaš do gore, evo prijave</h3>\n\n<h3><a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"https://forms.gle/uVsxxm3Yjfa98ZsDA\" tabindex=\"-1\"><img alt=\"remote ios akademija\" class=\"alignnone size-full wp-image-12205\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/remote-ios-akademija.png\" style=\"height:442px; width:885px\" /></a></h3>\n\n<p>Ako ti ne radi klik na sliku, <a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"http://bit.ly/FactoryiOSAkademija\" rel=\"noopener noreferrer\" tabindex=\"-1\" target=\"_blank\">evo linka na kojeg se možeš prijaviti</a> 🙂</p>\n\n<p>Za sva dodatna pitanja, slobodno se javite na <a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"mailto:hello@factory.hr\" tabindex=\"-1\">hello@factory.hr</a> i pratite nas na društvenim mrežama 🙂</p>\n'),(207,'fr','Započni karijeru kao iOS developer – otvorene su prijave na online iOS akademiju! ','<p><strong>Rok za prijave je 04.04.2021.</strong> prijaviti se mogu studenti, ne-studenti ili jednostavno rečeno – svi koji se žele okušati u iOS svijetu 🙂&nbsp;</p>\n\n<h2>Sigurno želiš znati kako smo zamislili online iOS akademiju? Čitaj dalje…</h2>\n\n<ul>\n	<li>Osigurat ćemo svu potrebnu <strong>opremu</strong> koja će ti stići doma netom prije početka akademije&nbsp;</li>\n	<li>Nakon prošlogodišnje iOS akademije, skupili smo dojmove i feedback polaznika te pripremili još <strong>više materijala i zadataka</strong> s kojima želimo podići kvalitetu akademije&nbsp;</li>\n	<li>Osigurali smo vrijeme za mentore i iOS tim koji će voditi iOS akademiju i biti dostupni preko Google Hangoutsa i Slacka, a također planiramo napraviti Discord kanal za polaznike iOS akademije gdje se možete družiti cijelo vrijeme&nbsp;</li>\n	<li>3 mjeseca <strong>zaokruženog procesa učenja o iOS programiranju</strong>&nbsp; gdje ćemo pokriti 10 ključnih poglavlja, zadatke i mentoriranje za svakog polaznika kako bi vas što bolje uveli u iOS svijet</li>\n</ul>\n\n<p><a href=\"https://factory.hr/blog/ios-akademija-recap\">Prva iOS akademija</a> rezultirala je zapošljavanjem novog kolege u našem iOS timu; održali smo 8 radionica, tjedne konzultacije sa svim članovima tima i polaznika te su nas polaznici po završetku akademije ocijenili prosječnom ocjenom od 4.8 po kvaliteti predavanja, predavačima i pripremi materijala i zadataka.&nbsp;</p>\n\n<h3>Remote/Online iOS akademija</h3>\n\n<ul>\n	<li>Factory je <strong>remote first tvrtka</strong> gdje smo utvrdili procese remote rada, stoga svaki zaposlenik zna u bilo kojem trenutku kome i kako se obratiti</li>\n	<li>S ovom iOS akademijom želimo <strong>dati šansu cijeloj Hrvatskoj</strong> i osigurati adekvatno učenje za područja u kojima inače nema sličnih akademija ili predavanja&nbsp;</li>\n	<li>2020.g smo dobili nagradu za<strong> najbolje stručne prakse</strong>, stoga imamo iskustva rada s početnicima i usmjeravanjem početnika kroz učenje programiranja na bilo kojim platformama</li>\n</ul>\n\n<p><a href=\"https://forms.gle/uVsxxm3Yjfa98ZsDA\"><img alt=\"remote ios akademija\" class=\"alignnone size-full wp-image-12205\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/remote-ios-akademija.png\" style=\"height:442px; width:885px\" /></a></p>\n\n<p>Ako ti ne radi klik na sliku, <a href=\"http://bit.ly/FactoryiOSAkademija\" rel=\"noopener noreferrer\" target=\"_blank\">evo linka na kojeg se možeš prijaviti</a> 🙂</p>\n\n<h2><strong>Detalji iOS akademije:</strong></h2>\n\n<p><strong>1. Korak – prijava</strong></p>\n\n<p>Prijave na iOS akademiju otvorene su&nbsp; od <strong>22.03.2021. – 04.04. 2021.</strong></p>\n\n<p>Sve koji se žele prijaviti na iOS akademiju molimo da pošalju svoj životopis i motivacijsko pismo. Također, ako imate dosadašnjih radova, slobodno stavite link do GitHub repozitorija 🙂&nbsp;</p>\n\n<p><strong>2. Korak – selekcija</strong></p>\n\n<p>Nakon <strong>zatvaranja prijava 04.04.2021.</strong>&nbsp; provest ćemo selekcijski postupak te izabrati <strong>5 najboljih kandidata</strong> koji će osigurati svoje mjesto na iOS akademiji! Trajanje selekcije je estimirano na mjesec dana, najviše ovisi o broju prijavljenih kandidata jer svakome želimo dati šansu da pokaže svoju motivaciju.&nbsp;</p>\n\n<p>Kako će izgledati selekcija:&nbsp;</p>\n\n<ul>\n	<li>Pregled prijava i motivacijskog pisma</li>\n	<li>Testiranje</li>\n	<li>Intervju</li>\n</ul>\n\n<p>U procesu selekcije bit ćemo usmjereni na razinu motivacije, koliko si je kandidat dao truda ranije u development te ambicije za daljnje učenje i razvoj.&nbsp;</p>\n\n<p><strong>3. Korak – početak iOS akademije</strong></p>\n\n<p>Početak akademije i prvo predavanje planiramo održati početkom 5.mjeseca. Dinamika radionica i termina će se dogovarati na tjednoj razini sukladno mogućnostima i potrebama polaznika.&nbsp;</p>\n\n<h2>Zašto je iOS akademija za tebe?</h2>\n\n<ul>\n	<li>Nedostaje ti adekvatna oprema&nbsp;</li>\n	<li>Želiš provjeriti dosadašnje znanje na konkretnim zadacima</li>\n	<li>Želiš pronaći mentora, upoznati iskusne kolege na koje možeš računati kad više ni sam/sama ne znaš pronaći rješenje</li>\n	<li>Ili, imaš iskustva u drugim tehnologijama, ali te zanima i iOS</li>\n</ul>\n\n<p><strong>Ako ti se ovakva ili slična pitanja motaju po glavi – prijavi se na iOS akademiju!&nbsp;</strong></p>\n\n<p>Oni koji se pronađu u iOS developmentu, uvijek je otvorena prilika za pridruživanju Factory timu kroz posao ili praksu – ovisno o trenutnom iskustvu. Ekipa smo koja voli čuti feedback na naš rad, želje koje imate pred sobom te kako vam Factory može pomoći da ih ostvarite.&nbsp;</p>\n\n<h2>Upoznaj mentore i voditelje iOS akademije</h2>\n\n<h3><strong>Josip, iOS developer&nbsp;</strong></h3>\n\n<p><img alt=\"predavac ios akademija\" class=\"alignnone size-full wp-image-12203\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/predavac-ios-akademija.png\" style=\"height:588px; width:885px\" /></p>\n\n<p>Josip se pridružio našem timu 2019. godine na <a href=\"https://factory.hr/blog/ios-developer-prakse\">iOS developer praksi</a><strong>, </strong>a danas je naš iOS developer koji će biti jedan od mentora i voditelja iOS akademije! Na prošlogodišnjoj iOS akademiji je također sudjelovao i pomagao iOS polaznicima te uvijek vrlo rado dijeli znanje i priča o novim Apple proizvodima. Trenutno radi na par iOS aplikacija za hrvatsko, američko i njemačko tržište.&nbsp;</p>\n\n<p>Uz Joleta i njegove fore vam sigurno neće biti dosadno na akademiji i uvijek će vam pomoći kada zapnete i ne znate što dalje googlati da dođete do rješenja.&nbsp;</p>\n\n<h3><strong>Zvonimir, ex iOS akademija polaznik, danas iOS developer&nbsp;</strong></h3>\n\n<p><img alt=\"predavaci iOS akademije\" class=\"alignnone size-full wp-image-12204\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/predavaci-iOS-akademije.png\" style=\"height:588px; width:885px\" /></p>\n\n<p>Zvonimir se našem timu pridružio na prošlogodišnjoj iOS akademiji gdje je uz mentore i radionice uspješno riješio sve zadatke koji su se našli pred njim i time osigurao poziciju iOS developera u našem timu! Danas je naš iOS developer koji radi na par projekata za hrvatsko, američko i njemačko tržište, a od njega možete iz prve ruke saznati kako je bilo na prošlogodišnjoj iOS akademiji:&nbsp;</p>\n\n<h2>“Uz mentora je sve lakše i zabavnije”</h2>\n\n<p><img alt=\"iOS akademija\" class=\"alignnone size-full wp-image-12201\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/iOS-akademija.png\" style=\"height:152px; width:885px\" /></p>\n\n<h3><strong>Matija, COO, Mobile team lead</strong></h3>\n\n<p><img alt=\"iOS akademija Osijek\" class=\"alignnone size-full wp-image-9353\" src=\"https://api.factory.hr/wp-content/uploads/2020/01/iOS-akademija-Osijek.jpg\" style=\"height:588px; width:885px\" /></p>\n\n<p>Kao alfa i omega našeg mobile tima, Matija je zadužen za kontrolu i provedbu iOS akademije. Broji petogodišnje iskustvo u razvoju Android i iOS aplikacija, izgradio je uspješan tim iza sebe te će uz našeg Josipa i Zvonimira biti zadužen za podršku i konzultacije.&nbsp;</p>\n\n<h2>Studentska udruga eStudent nagradila je naše <a href=\"https://factory.hr/blog/prakse-zlatni-indeks\" rel=\"noopener noreferrer\" target=\"_blank\">prakse Zlatnim indeksom&nbsp;</a></h2>\n\n<p>… a sada smo ih pitali kako vide našu iOS akademiju iz perspektive studenata:</p>\n\n<p><img alt=\"iOS akademija studenti\" class=\"alignnone size-full wp-image-12221\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/iOS-akademija-studenti.png\" style=\"height:899px; width:894px\" /> <img alt=\"ios development akademija\" class=\"alignnone size-full wp-image-12222\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/ios-development-akademija.png\" style=\"height:907px; width:894px\" /></p>\n\n<p><em>Hvala vrijednim studentima na divnim komentarima i riječima podrške, nadamo se da ćemo opravdati povjerenje! 🙂</em></p>\n\n<h2>Tko pita – ne skita</h2>\n\n<p><strong>Kada počinje Akademija?</strong></p>\n\n<p>Prva predavanja iOS akademije počinje početkom 5.mjeseca 2021. Točan datum ćemo dogovoriti tako da odgovara polaznicima i našim mentorima.&nbsp;</p>\n\n<p><strong>Trebam li imati predznanja iz iOS-a?</strong></p>\n\n<p>Ne. Sasvim je ok ako imaš predznanja iz bilo kojeg drugog područja – pr. Androida ili Weba.&nbsp;</p>\n\n<p><strong>Ne znam puno o programiranju, ima li smisla da se prijavim?</strong></p>\n\n<p>Naravno, svrha Akademije je naučiti.&nbsp;</p>\n\n<p><strong>Još sam student, nemam projekata iza sebe, mogu li se prijaviti?</strong></p>\n\n<p>Naravno! Cilj Akademije je pomoći onima koji imaju potencijala i ambicije postati iOS developeri.&nbsp;</p>\n\n<p><strong>Kako će izgledati radionice?</strong></p>\n\n<p>Radionice će biti praktične uz vodstvo i pomoć naših kolega iz iOS tima. Tempo i dinamika će se prilagođavati napretku polaznika. Cilj nam je pomoći vam da naučite što više i što bolje – ne da projurimo kroz definiran program.&nbsp;</p>\n\n<p><strong>Što ako budem odabran u Akademiju pa mi iskrsne neka obaveza i ne mogu prisustvovati određenoj radionici?</strong></p>\n\n<p>Nastojat ćemo prilagoditi termine mogućnostima i potrebama grupe – da većina uspije izvući maksimum.</p>\n\n<p><strong>Što ako nemam opremu?</strong></p>\n\n<p>Factory će osigurati opremu za sve polaznike koja će doći na tvoja vrata prije početka iOS akademije.</p>\n\n<p><strong>Koliko košta sudjelovanje u iOS akademiji?</strong></p>\n\n<p>Za polaznike je besplatno. Factory će osigurati mentore, opremu i vrijeme.&nbsp;</p>\n\n<p><strong>Kako će izgledati proces selekcije?</strong></p>\n\n<p>Prvo ćemo pregledati dobivene prijave (vaše CV i motivacijska pisma), nakon čega ćemo pozvati odabrane na psihologijsko i manje tehničko testiranje da vidimo trenutno predznanje te zatim na intervju.&nbsp;</p>\n\n<p><strong>Zašto samo 5 polaznika?</strong></p>\n\n<p>Smatramo da za 5 možemo osigurati dovoljno vremena i resursa da im se posvetimo kvalitetno i pružimo maksimalno. Cilj nam je dovesti nekoga do razine da nakon Akademije može samostalno nastaviti razvijati se ili početi raditi kao iOS developer. S povećanjem broja polaznika smanjuje se interakcija i posvećenost prema pojedinom polazniku. Također, voljeli bismo potaknuti i osigurati doživljaj timskog rada polaznicima tako da polaznici dobiju iskustvo i u tom aspektu.&nbsp;</p>\n\n<h3>Da ne skrolaš do gore, evo prijave</h3>\n\n<h3><a href=\"https://forms.gle/uVsxxm3Yjfa98ZsDA\"><img alt=\"remote ios akademija\" class=\"alignnone size-full wp-image-12205\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/remote-ios-akademija.png\" style=\"height:442px; width:885px\" /></a></h3>\n\n<p>Ako ti ne radi klik na sliku, <a href=\"http://bit.ly/FactoryiOSAkademija\" rel=\"noopener noreferrer\" target=\"_blank\">evo linka na kojeg se možeš prijaviti</a> 🙂</p>\n\n<p>Za sva dodatna pitanja, slobodno se javite na <a href=\"mailto:hello@factory.hr\">hello@factory.hr</a> i pratite nas na društvenim mrežama 🙂</p>\n');
