ije&nbsp; Nakon prošlogodišnje iOS akademije, skupili smo dojmove i feedback polaznika te pripremili još više materijala i zadataka s kojima želimo podići kvalitetu akademije&nbsp; Osigurali smo vrijeme za mentore i iOS tim koji će voditi iOS akademiju i biti dostupni preko Google Hangoutsa i Slacka, a također planiramo napraviti Discord kanal za polaznike iOS akademije gdje se možete družiti cijelo vrijeme&nbsp; 3 mjeseca zaokruženog procesa učenja o iOS programiranju&nbsp; gdje ćemo pokriti 10 ključnih poglavlja, zadatke i mentoriranje za svakog polaznika kako bi vas što bolje uveli u iOS svijet <a href=\"https://factory.hr/blog/ios-akademija-recap\">Prva iOS akademija</a> rezultirala je zapošljavanjem novog kolege u našem iOS timu; održali smo 8 radionica, tjedne konzultacije sa svim članovima tima i polaznika te su nas polaznici po završetku akademije ocijenili prosječnom ocjenom od 4.8 po kvaliteti predavanja, predavačima i pripremi materijala i zadataka.&nbsp; Remote/Online iOS akademija Factory je remote first tvrtka gdje smo utvrdili procese remote rada, stoga svaki zaposlenik zna u bilo kojem trenutku kome i kako se obratiti S ovom iOS akademijom želimo dati šansu cijeloj Hrvatskoj i osigurati adekvatno učenje za područja u kojima inače nema sličnih akademija ili predavanja&nbsp; 2020.g smo dobili nagradu za najbolje stručne prakse, stoga imamo iskustva rada s početnicima i usmjeravanjem početnika kroz učenje programiranja na bilo kojim platformama <a href=\"https://forms.gle/uVsxxm3Yjfa98ZsDA\"><img alt=\"remote ios akademija\" class=\"alignnone size-full wp-image-12205\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/remote-ios-akademija.png\" style=\"height:442px; width:885px\" /></a> Ako ti ne radi klik na sliku, <a href=\"http://bit.ly/FactoryiOSAkademija\" rel=\"noopener noreferrer\" target=\"_blank\">evo linka na kojeg se možeš prijaviti</a> 🙂 Detalji iOS akademije: 1. Korak – prijava Prijave na iOS akademiju otvorene su&nbsp; od 22.03.2021. – 04.04. 2021. Sve koji se žele prijaviti na iOS akademiju molimo da pošalju svoj životopis i motivacijsko pismo. Također, ako imate dosadašnjih radova, slobodno stavite link do GitHub repozitorija 🙂&nbsp; 2. Korak – selekcija Nakon zatvaranja prijava 04.04.2021.&nbsp; provest ćemo selekcijski postupak te izabrati 5 najboljih kandidata koji će osigurati svoje mjesto na iOS akademiji! Trajanje selekcije je estimirano na mjesec dana, najviše ovisi o broju prijavljenih kandidata jer svakome želimo dati šansu da pokaže svoju motivaciju.&nbsp; Kako će izgledati selekcija:&nbsp; Pregled prijava i motivacijskog pisma Testiranje Intervju U procesu selekcije bit ćemo usmjereni na razinu motivacije, koliko si je kandidat dao truda ranije u development te ambicije za daljnje učenje i razvoj.&nbsp; 3. Korak – početak iOS akademije Početak akademije i prvo predavanje planiramo održati početkom 5.mjeseca. Dinamika radionica i termina će se dogovarati na tjednoj razini sukladno mogućnostima i potrebama polaznika.&nbsp; Zašto je iOS akademija za tebe? Nedostaje ti adekvatna oprema&nbsp; Želiš provjeriti dosadašnje znanje na konkretnim zadacima Želiš pronaći mentora, upoznati iskusne kolege na koje možeš računati kad više ni sam/sama ne znaš pronaći rješenje Ili, imaš iskustva u drugim tehnologijama, ali te zanima i iOS Ako ti se ovakva ili slična pitanja motaju po glavi – prijavi se na iOS akademiju!&nbsp; Oni koji se pronađu u iOS developmentu, uvijek je otvorena prilika za pridruživanju Factory timu kroz posao ili praksu – ovisno o trenutnom iskustvu. Ekipa smo koja voli čuti feedback na naš rad, želje koje imate pred sobom te kako vam Factory može pomoći da ih ostvarite.&nbsp; Upoznaj mentore i voditelje iOS akademije Josip, iOS developer&nbsp; <img alt=\"predavac ios akademija\" class=\"alignnone size-full wp-image-12203\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/predavac-ios-akademija.png\" style=\"height:588px; width:885px\" /> Josip se pridružio našem timu 2019. godine na <a href=\"https://factory.hr/blog/ios-developer-prakse\">iOS developer praksi</a>, a danas je naš iOS developer koji će biti jedan od mentora i voditelja iOS akademije! Na prošlogodišnjoj iOS akademiji je također sudjelovao i pomagao iOS polaznicima te uvijek vrlo rado dijeli znanje i priča o novim Apple proizvodima. Trenutno radi na par iOS aplikacija za hrvatsko, američko i njemačko tržište.&nbsp; Uz Joleta i njegove fore vam sigurno neće biti dosadno na akademiji i uvijek će vam pomoći kada zapnete i ne znate što dalje googlati da dođete do rješenja.&nbsp; Zvonimir, ex iOS akademija polaznik, danas iOS developer&nbsp; <img alt=\"predavaci iOS akademije\" class=\"alignnone size-full wp-image-12204\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/predavaci-iOS-akademije.png\" style=\"height:588px; width:885px\" /> Zvonimir se našem timu pridružio na prošlogodišnjoj iOS akademiji gdje je uz mentore i radionice uspješno riješio sve zadatke koji su se našli pred njim i time osigurao poziciju iOS developera u našem timu! Danas je naš iOS developer koji radi na par projekata za hrvatsko, američko i njemačko tržište, a od njega možete iz prve ruke saznati kako je bilo na prošlogodišnjoj iOS akademiji:&nbsp; “Uz mentora je sve lakše i zabavnije” <img alt=\"iOS akademija\" class=\"alignnone size-full wp-image-12201\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/iOS-akademija.png\" style=\"height:152px; width:885px\" /> Matija, COO, Mobile team lead <img alt=\"iOS akademija Osijek\" class=\"alignnone size-full wp-image-9353\" src=\"https://api.factory.hr/wp-content/uploads/2020/01/iOS-akademija-Osijek.jpg\" style=\"height:588px; width:885px\" /> Kao alfa i omega našeg mobile tima, Matija je zadužen za kontrolu i provedbu iOS akademije. Broji petogodišnje iskustvo u razvoju Android i iOS aplikacija, izgradio je uspješan tim iza sebe te će uz našeg Josipa i Zvonimira biti zadužen za podršku i konzultacije.&nbsp; Studentska udruga eStudent nagradila je naše <a href=\"https://factory.hr/blog/prakse-zlatni-indeks\" rel=\"noopener noreferrer\" target=\"_blank\">prakse Zlatnim indeksom&nbsp;</a> … a sada smo ih pitali kako vide našu iOS akademiju iz perspektive studenata: <img alt=\"iOS akademija studenti\" class=\"alignnone size-full wp-image-12221\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/iOS-akademija-studenti.png\" style=\"height:899px; width:894px\" /> <img alt=\"ios development akademija\" class=\"alignnone size-full wp-image-12222\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/ios-development-akademija.png\" style=\"height:907px; width:894px\" /> Hvala vrijednim studentima na divnim komentarima i riječima podrške, nadamo se da ćemo opravdati povjerenje! 🙂 Tko pita – ne skita Kada počinje Akademija? Prva predavanja iOS akademije počinje početkom 5.mjeseca 2021. Točan datum ćemo dogovoriti tako da odgovara polaznicima i našim mentorima.&nbsp; Trebam li imati predznanja iz iOS-a? Ne. Sasvim je ok ako imaš predznanja iz bilo kojeg drugog područja – pr. Androida ili Weba.&nbsp; Ne znam puno o programiranju, ima li smisla da se prijavim? Naravno, svrha Akademije je naučiti.&nbsp; Još sam student, nemam projekata iza sebe, mogu li se prijaviti? Naravno! Cilj Akademije je pomoći onima koji imaju potencijala i ambicije postati iOS developeri.&nbsp; Kako će izgledati radionice? Radionice će biti praktične uz vodstvo i pomoć naših kolega iz iOS tima. Tempo i dinamika će se prilagođavati napretku polaznika. Cilj nam je pomoći vam da naučite što više i što bolje – ne da projurimo kroz definiran program.&nbsp; Što ako budem odabran u Akademiju pa mi iskrsne neka obaveza i ne mogu prisustvovati određenoj radionici? Nastojat ćemo prilagoditi termine mogućnostima i potrebama grupe – da većina uspije izvući maksimum. Što ako nemam opremu? Factory će osigurati opremu za sve polaznike koja će doći na tvoja vrata prije početka iOS akademije. Koliko košta sudjelovanje u iOS akademiji? Za polaznike je besplatno. Factory će osigurati mentore, opremu i vrijeme.&nbsp; Kako će izgledati proces selekcije? Prvo ćemo pregledati dobivene prijave (vaše CV i motivacijska pisma), nakon čega ćemo pozvati odabrane na psihologijsko i manje tehničko testiranje da vidimo trenutno predznanje te zatim na intervju.&nbsp; Zašto samo 5 polaznika? Smatramo da za 5 možemo osigurati dovoljno vremena i resursa da im se posvetimo kvalitetno i pružimo maksimalno. Cilj nam je dovesti nekoga do razine da nakon Akademije može samostalno nastaviti razvijati se ili početi raditi kao iOS developer. S povećanjem broja polaznika smanjuje se interakcija i posvećenost prema pojedinom polazniku. Također, voljeli bismo potaknuti i osigurati doživljaj timskog rada polaznicima tako da polaznici dobiju iskustvo i u tom aspektu.&nbsp; Da ne skrolaš do gore, evo prijave <a href=\"https://forms.gle/uVsxxm3Yjfa98ZsDA\"><img alt=\"remote ios akademija\" class=\"alignnone size-full wp-image-12205\" src=\"https://api.factory.hr/wp-content/uploads/2021/03/remote-ios-akademija.png\" style=\"height:442px; width:885px\" /></a> Ako ti ne radi klik na sliku, <a href=\"http://bit.ly/FactoryiOSAkademija\" rel=\"noopener noreferrer\" target=\"_blank\">evo linka na kojeg se možeš prijaviti</a> 🙂 Za sva dodatna pitanja, slobodno se javite na <a href=\"mailto:hello@factory.hr\">hello@factory.hr</a> i pratite nas na društvenim mrežama 🙂 ');
