ademijom želimo dati šansu cijeloj Hrvatskoj osigurati adekvatno učenje područja kojima inače nema sličnih akademija ili predavanja  2020.g dobili nagradu najbolje stručne prakse stoga imamo iskustva rada početnicima usmjeravanjem početnika kroz učenje programiranja bilo kojim platformama Ako radi klik sliku evo linka kojeg možeš prijaviti Detalji Korak prijava Prijave akademiju otvorene su  22.03.2021. 04.04. 2021. Sve koji žele prijaviti akademiju molimo pošalju svoj životopis motivacijsko pismo. Također ako imate dosadašnjih radova slobodno stavite link GitHub repozitorija Korak selekcija Nakon zatvaranja prijava 04.04.2021.  provest ćemo selekcijski postupak izabrati najboljih kandidata osigurati svoje mjesto akademiji! Trajanje selekcije estimirano mjesec dana najviše ovisi broju prijavljenih kandidata jer svakome želimo dati šansu pokaže svoju motivaciju.  Kako izgledati selekcija Pregled prijava motivacijskog pisma Testiranje Intervju procesu selekcije bit usmjereni razinu motivacije koliko kandidat dao truda ranije development ambicije daljnje učenje razvoj.  Korak početak Početak prvo predavanje planiramo održati početkom 5.mjeseca. Dinamika radionica termina dogovarati tjednoj razini sukladno mogućnostima potrebama polaznika.  Zašto tebe? Nedostaje adekvatna oprema  Želiš provjeriti dosadašnje znanje konkretnim zadacima Želiš pronaći mentora upoznati iskusne kolege koje možeš računati kad više sam/sama znaš pronaći rješenje Ili imaš iskustva drugim tehnologijama ali zanima Ako ovakva ili slična pitanja motaju glavi prijavi akademiju!  Oni pronađu developmentu uvijek otvorena prilika pridruživanju Factory timu kroz posao praksu ovisno trenutnom iskustvu. Ekipa koja voli čuti feedback naš rad želje koje imate pred sobom vam Factory može pomoći ostvarite.  Upoznaj mentore voditelje Josip developer  Josip pridružio našem timu 2019. godine developer praksi danas naš developer biti jedan mentora voditelja akademije! prošlogodišnjoj akademiji također sudjelovao pomagao polaznicima uvijek vrlo rado dijeli znanje priča novim Apple proizvodima. Trenutno radi par aplikacija hrvatsko američko njemačko tržište.  Joleta njegove fore vam sigurno neće biti dosadno akademiji uvijek vam pomoći kada zapnete znate što dalje googlati dođete rješenja.  Zvonimir polaznik danas developer  Zvonimir našem pridružio prošlogodišnjoj akademiji mentore radionice uspješno riješio sve zadatke našli pred njim time osigurao poziciju developera timu! Danas naš radi par projekata hrvatsko američko njemačko tržište njega možete prve ruke saznati bilo prošlogodišnjoj “Uz mentora sve lakše zabavnije” Matija COO Mobile team lead Kao alfa omega našeg mobile tima Matija zadužen kontrolu provedbu akademije. Broji petogodišnje iskustvo razvoju Android aplikacija izgradio uspješan tim iza sebe našeg Josipa Zvonimira zadužen podršku konzultacije.  Studentska udruga eStudent nagradila naše prakse Zlatnim indeksom  sada pitali vide našu perspektive studenata Hvala vrijednim studentima divnim komentarima riječima podrške nadamo opravdati povjerenje! Tko pita skita Kada počinje Akademija? Prva predavanja počinje početkom 5.mjeseca 2021. Točan datum dogovoriti tako odgovara polaznicima našim mentorima.  Trebam imati predznanja iOS-a? Ne. Sasvim ako imaš predznanja kojeg drugog područja pr. Androida Weba.  znam puno programiranju ima smisla prijavim? Naravno svrha Akademije naučiti.  Još sam student nemam projekata iza sebe mogu prijaviti? Naravno! Cilj Akademije pomoći onima imaju potencijala ambicije postati developeri.  Kako izgledati radionice? Radionice praktične vodstvo pomoć naših kolega tima. Tempo dinamika prilagođavati napretku polaznika. Cilj nam naučite što više bolje projurimo kroz definiran program.  Što ako budem odabran Akademiju iskrsne neka obaveza mogu prisustvovati određenoj radionici? Nastojat prilagoditi termine mogućnostima potrebama grupe većina uspije izvući maksimum. Što nemam opremu? osigurati opremu sve polaznike koja doći tvoja vrata prije početka akademije. Koliko košta sudjelovanje akademiji? polaznike besplatno. opremu vrijeme.  Kako izgledati proces selekcije? Prvo pregledati dobivene prijave (vaše motivacijska pisma) nakon čega pozvati odabrane psihologijsko manje tehničko testiranje vidimo trenutno predznanje zatim intervju.  Zašto samo polaznika? Smatramo možemo dovoljno vremena resursa posvetimo kvalitetno pružimo maksimalno. Cilj nam dovesti nekoga razine nakon Akademije može samostalno nastaviti razvijati početi raditi kao developer. povećanjem broja smanjuje interakcija posvećenost prema pojedinom polazniku. Također voljeli bismo potaknuti doživljaj timskog rada polaznicima tako polaznici dobiju iskustvo tom aspektu.  skrolaš gore evo Ako klik sliku evo linka kojeg možeš sva dodatna pitanja slobodno javite hello#factory.hr pratite nas društvenim mrežama Započni karijeru kao otvorene online akademiju! Rok 04.04.2021. studenti ne-studenti jednostavno rečeno svi žele okušati svijetu Sigurno želiš znati zamislili akademiju? Čitaj dalje… Osigurat svu potrebnu stići doma netom prije početka akademije  Nakon prošlogodišnje skupili dojmove feedback pripremili još materijala zadataka kojima podići kvalitetu Osigurali vrijeme tim voditi dostupni preko Google Hangoutsa Slacka također planiramo napraviti Discord kanal možete družiti cijelo vrijeme  mjeseca zaokruženog procesa učenja programiranju  pokriti ključnih poglavlja zadatke mentoriranje svakog vas bolje uveli svijet Prva rezultirala zapošljavanjem novog kolege održali radionica tjedne konzultacije svim članovima tima nas polaznici završetku ocijenili prosječnom ocjenom 4.8 kvaliteti predavanja predavačima pripremi zadataka.  Remote/Online remote first tvrtka utvrdili procese stoga svaki zaposlenik zna kojem trenutku kome obratiti ovom akademijom dati šansu cijeloj Hrvatskoj adekvatno područja inače nema sličnih predavanja  2020.g dobili nagradu najbolje stručne prakse imamo iskustva početnicima usmjeravanjem početnika programiranja kojim platf